Two methods are currently used. First, with GET we register a new GET route for a handler function. The handler is accessed via the address path. The handler for a GET method can set the node to perform certain actions. webapi.Server().GET("path", HandlerFunc)
``` A command can be sent to the node software to the API, e.g. via command prompt: curl "http://127.0.0.1:8080/path?command" $$ . $$ Second, with `POST` we register a new POST route for a handler function. The handler can receive a JSON body input and send specific messages to the tangle. webapi.Server().POST("path", HandlerFunc) For example, the following Handler `broadcastData` sends a data message to the tangle func broadcastData(c echo.Context) error { var request Request if err := c.Bind(&request); err != nil { log.Info(err.Error()) return c.JSON(http.StatusBadRequest, Response{Error: err.Error()}) } msg, err := issuer.IssuePayload( payload.NewGenericDataPayload(request.Data), messagelayer.Tangle())
if err != nil { return c.JSON(http.StatusBadRequest, Response{Error: err.Error()})
}
return c.JSON(http.StatusOK, Response{ID: msg.ID().String()}) } As an example the JSON body { "data":"HelloWor" } can be sent to `http://127.0.0.1:8080/data`, which will issue a data message containing "HelloWor" (note that in this example the data input is size limited.)

